import { Link } from "react-router-dom"

export default () => {
    return (
        <div>
            <nav class="navbar navbar-dark bg-dark">
                <Link class="navbar-brand" to="/login/todayPicture">TodayImage</Link>
                <Link class="navbar-brand" to="/login/historyPicture">historyPicture</Link>
                <Link class="navbar-brand" to="/login/picture">TodayImage</Link>

            </nav>


        </div>

    )
}
